import React from "react";
import Flex from "./layout/Flex";
import "../styles/links.css";
import git from "../assets/icons/git.svg";
import slack from "../assets/icons/slack.svg";

const link = (props) => {
  return (
    <Flex
      className=" bg-gray"
      jc="center"
      //   key={index}
      style={{
        paddingTop: "24px",
        paddingBottom: "24px",
        borderRadius: "8px",
      }}
    >
      <p>{props.text}</p>
    </Flex>
  );
};

const Links = () => {
  return (
    <div className=" links-padding">
      <Flex stack={true} spacing={24}>
        <a href="https://google.com" target="_blank">
          <Flex
            className=" bg-gray"
            jc="center"
            //   key={index}
            style={{
              paddingTop: "24px",
              paddingBottom: "24px",
              borderRadius: "8px",
            }}
          >
            <p>Twitter Link</p>
          </Flex>
        </a>

        <Flex className="" jc="center" spacing={27}>
          <img src={slack} alt="" />
          <img src={git} alt="" />
        </Flex>
        <div></div>
        <div></div>
        <div></div>
      </Flex>
    </div>
  );
};

export default Links;
